import React, { Component } from 'react';
import {Container, Row, Col, Navbar, Nav, NavItem, NavLink} from 'reactstrap';
import './css/app.css'
import { BrowserRouter, Switch, Route } from 'react-router-dom';
import NavigationBar from './components/layout/NavigationBar';
import Home from './Home'
import Dashboard from './components/dashboard/Dashboard';
import NoMatchPage from './NoMatchPage';

class App extends Component {
    render() {
        return(
            <BrowserRouter>
            <NavigationBar />
            <Container>      
                    <Switch>
                        <Route path='/' exact component={Home}/>
                        <Route path='/dashboard' exact component={Dashboard}/>
                        <Route component={NoMatchPage} />
                    </Switch>

    <Row>
      <Col tag="nav" sm={3} md={2} className="d-none d-sm-block bg-light sidebar">
        <Nav pills vertical>
          <NavItem>
            <NavLink active href="#">Stuff</NavLink>
          <NavItem>
          </NavItem>
            <NavLink href="#">Stuff</NavLink>
          </NavItem>
        </Nav>
      </Col>
      <Col tag="main" sm={9} md={10} className="ml-sm-auto pt-3" role="main">
        Main Content Stuff Here
      </Col>
    </Row>

            </Container>
            </BrowserRouter>

        );
    }
}

export default App;
